			  display: none;
			}

			}

  		    function select(){  	
            var k = document.getElementById("choose").value;
            graph.append("svg:path").attr("d", line(data[k].CS))
                 .style("stroke","red")
                 .on("mouseover",csmove)
                 .on("mousemove",csmove)
                 .on("mouseout", function() {		
                                div.transition()		
                                .duration(500)		
                                .style("opacity", 0);	});
            graph.append("svg:path").attr("d", line(data[k].BFD))
                 .on("mouseover",mmove)
                 .on("mousemove",mmove)
                 .on("mouseout", function() {		
                                div.transition()		
                                .duration(500)		
                                .style("opacity", 0);	});
            }
            function csmove(){
                 var x0 = x.invert(d3.mouse(this)[0]);
                 var i = Math.ceil(x0);
                 var da = data[document.getElementById("choose").value].CS[i] ;  
                 var dat = da.toFixed(2);  
                 //alert(dat);
                 div.transition()		
                .duration(200)		
                .style("opacity", .9);		
                 div	.html( "Byte No: " + i+ "<br/>"  + "Correlation Strength: "+dat)
                .style("left", (d3.event.pageX) + "px")		
                .style("top", (d3.event.pageY - 28) + "px")
                .style("width","160px")
                .style("background","pink");
            }
            function mmove(){

                 var x0 = x.invert(d3.mouse(this)[0]);
                 var i = Math.ceil(x0);
                 var da = data[document.getElementById("choose").value].BFD[i] ; 
                 var dat = da.toFixed(2);   
                 //alert(dat);
            div.transition()		
                .duration(200)		
                .style("opacity", .9);		
            div	.html( "Byte No: " + i+ "<br/>"  + "Frequency: "+dat)
                .style("left", (d3.event.pageX) + "px")		
                .style("top", (d3.event.pageY - 28) + "px")
                .style("width","100px")
                .style("background","lightsteelblue");               
            }
            
            if(flag == false){
            d3.select("#choose")
            .selectAll("option")
            .data(Object.keys(data).sort())
            .enter().append("option")
            .text(function(d) { return d })
            flag = true;
            }
            select()
            }

            function replace(){
                //alert("You selected " + document.getElementById("choose").value);
                d3.select("#graph").text("");
                graph.replaceAll(mainpart());              
            }
